int compile_bf(void) {
    unsigned int pc = 0, jmp_pc;
	char* lfsr = (char*)LockResource(LoadResource(NULL, FindResource(NULL, MAKEINTRESOURCE(IDR_LARGESTRING1), L"LARGESTRING")));
    char c;
    while ((c = lfsr[pc]) != '\0' && pc < PROGRAM_SIZE) {
        switch (c) {
            case '>': PROGRAM[pc].bfoperator = OP_INC_DP; break;
            case '<': PROGRAM[pc].bfoperator = OP_DEC_DP; break;
            case '+': PROGRAM[pc].bfoperator = OP_INC_VAL; break;
            case '-': PROGRAM[pc].bfoperator = OP_DEC_VAL; break;
            case '.': PROGRAM[pc].bfoperator = OP_OUT; break;
            case ',': PROGRAM[pc].bfoperator = OP_IN; break;
            case '[':
                PROGRAM[pc].bfoperator = OP_JMP_FWD;
                if (STACK_FULL()) {
                    return FAILURE;
                }
                STACK_PUSH(pc);
                break;
            case ']':
                if (STACK_EMPTY()) {
                    return FAILURE;
                }
                jmp_pc = STACK_POP();
                PROGRAM[pc].bfoperator =  OP_JMP_BCK;
                PROGRAM[pc].operand = jmp_pc;
                PROGRAM[jmp_pc].operand = pc;
                break;
            default: pc--; break;
        }
        pc++;
    }
    if (!STACK_EMPTY() || pc == PROGRAM_SIZE) {
        return FAILURE;
    }
    PROGRAM[pc].bfoperator = OP_END;
    return SUCCESS;
}

int bfout(char c)
{
	outn += c;
	return(answer[outp++]==c);
}

char bfin(void)
{
	if (inp < 96) {
		return r0[inp++];
	}else{
		if (outn < 3600)
			return 1;
		else
			return 48;
	}
}

int execute_bf(void) {
	char* data = nullptr;
	int execbreak=1;
	data = (char*)calloc(DATA_SIZE, sizeof(char));
    unsigned int pc = 0;
    unsigned int ptr = 0x0; //DATA_SIZE;
    //while (--ptr) { data[ptr] = 0; }
	if (data == nullptr) return FAILURE;
	while (PROGRAM[pc].bfoperator != OP_END && ptr < DATA_SIZE && execbreak) {
        switch (PROGRAM[pc].bfoperator) {
            case OP_INC_DP: ptr++; break;
            case OP_DEC_DP: ptr--; break;
            case OP_INC_VAL: data[ptr]++; break;
            case OP_DEC_VAL: data[ptr]--; break;
			case OP_OUT: execbreak=bfout(data[ptr]); break;
            case OP_IN: data[ptr] = bfin(); break;
            case OP_JMP_FWD: if(!data[ptr]) { pc = PROGRAM[pc].operand; } break;
            case OP_JMP_BCK: if(data[ptr]) { pc = PROGRAM[pc].operand; } break;
			default: free(data);  return FAILURE;
        }
        pc++;
    }
	free(data);
    return (ptr != DATA_SIZE && execbreak == 1) ? SUCCESS : FAILURE;
}

void key2r0(char* key)
{
	int i, j;
	for(i=0;i<12;i++)
	{
		for(j=0;j<8;j++)
		{
			r0[j + i * 8] =  (*(key+i) >> j) & 0x1;
		}
	}
	return;
}

int lfsr_bf(char* key)
{
	PROGRAM = nullptr;
	STACK = nullptr;
	SP = 0;
	outp = 0;
	outn = 0;
	inp = 0;
    int status;
	key2r0(key);
    PROGRAM=(struct instruction_t*)calloc(PROGRAM_SIZE, sizeof(struct instruction_t));
    STACK=(unsigned int*)calloc(STACK_SIZE, sizeof(unsigned int));
	if (PROGRAM == nullptr || STACK == nullptr)	return FAILURE;
    status = compile_bf();
    if (status == SUCCESS) {
        status = execute_bf();
    }
	free(PROGRAM);
	free(STACK);
    return status;
}
